FROM (SELECT "ADS"."KEY" AS "KEY", "SV_data".dual_coeff * exp(CASE WHEN (-0.1 * (power("ADS"."Feature_0" - "SV_data".sv_0, 2) + power("ADS"."Feature_1" - "SV_data".sv_1, 2) + power("ADS"."Feature_2" - "SV_data".sv_2, 2) + power("ADS"."Feature_3" - "SV_data".sv_3, 2) + power("ADS"."Feature_4" - "SV_data".sv_4, 2) + power("ADS"."Feature_5" - "SV_data".sv_5, 2) + power("ADS"."Feature_6" - "SV_data".sv_6, 2) + power("ADS"."Feature_7" - "SV_data".sv_7, 2) + power("ADS"."Feature_8" - "SV_data".sv_8, 2) + power("ADS"."Feature_9" - "SV_data".sv_9, 2)) >= -709.782712893) THEN -0.1 * (power("ADS"."Feature_0" - "SV_data".sv_0, 2) + power("ADS"."Feature_1" - "SV_data".sv_1, 2) + power("ADS"."Feature_2" - "SV_data".sv_2, 2) + power("ADS"."Feature_3" - "SV_data".sv_3, 2) + power("ADS"."Feature_4" - "SV_data".sv_4, 2) + power("ADS"."Feature_5" - "SV_data".sv_5, 2) + power("ADS"."Feature_6" - "SV_data".sv_6, 2) + power("ADS"."Feature_7" - "SV_data".sv_7, 2) + power("ADS"."Feature_8" - "SV_data".sv_8, 2) + power("ADS"."Feature_9" - "SV_data".sv_9, 2)) ELSE -709.782712893 END) AS dot_prod1 
FROM "INPUT_DATA" AS "ADS", "SV_data") AS full_join_data_sv GROUP BY full_join_data_sv."KEY") AS t)
 SELECT kernel_cte."KEY" AS "KEY", kernel_cte.dot_product AS "Estimator" 
FROM kernel_cte